// Home.js

import React, { Component } from 'react';
import B from '../assets/imgs/bg.jpg'
class Home extends Component {
    render() {
        return (
            <div style={{backgroundImage: `url(${B})`}}>
                <h2>Gate Of Egypt</h2>
            </div>
        );
    }
}

export default Home;
